import { Switch } from '@material-ui/core';
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Header from './components/Header';

function App() {
  return (
    <>
    <BrowserRouter>
      <Header/>
        <Switch>
          <Route exact path="/login" component={Login}/>
        </Switch>
    </BrowserRouter>
    </>
  );
}

export default App;
